import React from 'react';
import { useState } from 'react';

import Grid from './components/Grid';
import './Board.css';

function Board({ matrix }) {
  return (
    <div className="board">
      <button className="help">Pidele ayuda a la aguilas</button>
      {matrix && matrix.map(row => (
        <div className="row">
          {row && row.map(grid =>
            <Grid enabled={grid.enabled} active={grid.active} />
          )}
        </div>
      ))}
    </div>
  );
}

export default Board;
